import _ from 'lodash'

export function getSum(transactions, type){
    let sum = _(transactions)
            .groupBy('type')
            .map((objs, key)=>{
                if(!type)return _.sumBy(objs,"amount")
                return{
                    'type': key,
                    'color': objs[0].color,
                    'total': _.sumBy(objs,'amount'),
                }
            })
            .value()
        console.log(sum)
}

